import React from 'react';
import { useLocation } from 'react-router-dom';

interface FlightDetailsProps {
    lastName: string;
    flightNumber: string;
}

const FlightDetails: React.FC<FlightDetailsProps> = ({ lastName, flightNumber }) => {
    // Use lastName and flightNumber in your component
    return (
        <div className="landing-page">
     
            <div className="flight-details">
                <h1>Hello, {lastName}</h1>
                <p>Your flight number: {flightNumber}</p>
            </div>
        </div>
    );
};

export default FlightDetails;
